117	2015-03-14 03:21:01.905411	2015-03-14 03:21:01.905411	651258118326617	Job Shadow Syracuse	Job Shadow Syracuse is a joint initiative of 40 Below Syracuse and Junior Achievement. Together, we have established a job shadow program to help Central New York high school students learn about and experience work environments. \n\nBefore the job shadowing takes place, we have in-class sessions to help students prepare for their exciting day with a local professional. Concluding the experience is another in-class session to review lessons and observations. \n\nWe are actively looking for job hosts, CNY schools, and CNY students to participate in the program. \n\nSign up today to host a student at www.jobshadowsyracuse.com!\n\nFollow us at www.twitter.com/jobshadowcuse . 
